export default function App() {
  const [userName, setUserName] = useState('')

  const onChangeHandler = (e) =>{
     console.log('event---', e.target.value);
     setUserName(e.target.value)
  }



  return (
    <div>
      <div>Name: <input onChange={onChangeHandler} placeholder='enter your name' type='text' /> </div>
      <div>Email: <input onChange={onChangeHandler} placeholder='enter your Email' type='text' /> </div>
      <div>Roll No.: <input onChange={onChangeHandler} placeholder='enter your Roll No.' type='text' /> </div>
      <div>Class: <input onChange={onChangeHandler} placeholder='enter your Class' type='text' /> </div>

    </div>
  )
}
